class Solution(object):
    def solve(self, board):
        """
        :type board: List[List[str]]
        :rtype: void Do not return anything, modify board in-place instead.
        """
        if len(board) == 0:
            return
        w, h = len(board[0]), len(board)
        for j in range(w):
            if board[0][j] == 'O':
                board[0][j].replace('O', 'P')
            if board[h - 1][j] == 'O':
                board[h - 1][j].replace('O', 'P')

        for i in range(h):
            if board[i][0] == 'O':
                board[i][0].replace('O', 'P')
            if board[i][w - 1] == 'O':
                board[i][w - 1].replace('O', 'P')

        for i in range(1, h):
            for j in range(1, w):
                if board[i-1][j] == 'P' or board[i][j-1] == 'P':
                    if board[i][j] == 'O':
                        board[i][j].replace('O', 'P')
                    elif board[i][j] == 'X':
                        board[i][j].replace('X', 'P')
                    else:
                        continue

        for i in range(h - 2, 0, -1):
            for j in range(w - 2, 0, -1):
                if board[i+1][j] == 'P' or board[i][j+1] == 'P':
                    if board[i][j] == 'O':
                        board[i][j].replace('O', 'P')
                    elif board[i][j] == 'X':
                        board[i][j].replace('X', 'P')
                    else:
                        continue

        for x in range(h):
            for y in range(w):
                if board[x][y] == 'O':
                    board[x][y].replace('O', 'X')
                elif board[x][y] == 'P':
                    board[x][y].replace('P', 'O')
                else:
                    continue

    def solve0(self, board):
        """
        :type board: List[List[str]]
        :rtype: void Do not return anything, modify board in-place instead.
        """
        if len(board) == 0:
            return
        w, h = len(board[0]), len(board)
        visited = [[0 for x in range(w)] for y in range(h)]
        for y in range(w):
            if board[0][y] == 'O':
                self.helper_func(0, y, visited, board)
            if board[h-1][y] == 'O':
                self.helper_func(h-1, y, visited, board)

        for x in range(h):
            if board[x][0] == 'O':
                self.helper_func(x, 0, visited, board)
            if board[x][w-1] == 'O':
                self.helper_func(x, w-1, visited, board)

        for x in range(h):
            for y in range(w):
                if board[x][y] == 'O':
                    board[x][y] = 'X'
                elif board[x][y] == 'P':
                    board[x][y] = 'O'

    def helper_func(self, x, y, visited, board):
        col = len(board[0])
        row = len(board)
        if x < 0 or y < 0 or x >= row or y >= col or visited[x][y] == 1 or board[x][y] == 'X':
            return
        else:
            visited[x][y] = 1
            board[x][y] = 'P'
            self.helper_func(x-1, y, visited, board)
            self.helper_func(x+1, y, visited, board)
            self.helper_func(x, y-1, visited, board)
            self.helper_func(x, y+1, visited, board)



